import React from "react";
import Col from "react-bootstrap/Col";

//import { Link } from "react-router-dom";

const EuromillonCard = ({numeros,  estrellas, millon
}) => {
  return (
    <Col className="coaster-card" md={4}>
      <h3>Resultado del Euromillon del d√≠a </h3>
      <p>{numeros}</p> <p>{estrellas}</p> <p>{millon}</p>
    </Col>
  );
};

export default EuromillonCard;
